import React, { useState } from 'react';

const BuyNow = ({ selectedItems, onClose, onOrderPlaced }) => {
    const [cardInfo, setCardInfo] = useState({
        cardNumber: '',
        cardName: '',
        expires: '',
        cvc: '',
    });

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setCardInfo({ ...cardInfo, [name]: value });
    };

    const handleBuyNow = () => {
        // You can add logic to validate the card information here
        // For simplicity, let's assume the validation is successful

        // Clear the card information
        setCardInfo({
            cardNumber: '',
            cardName: '',
            expires: '',
            cvc: '',
        });

        // Trigger the order placed callback
        onOrderPlaced();
    };

    return (
        <div className="modal" style={{ display: 'block' }}>
            <div className="modal-dialog">
                <div className="modal-content">
                    <div className="modal-header">
                        <h5 className="modal-title">Checkout</h5>
                        <button type="button" className="btn-close" onClick={onClose} aria-label="Close"></button>
                    </div>
                    <div className="modal-body">
                        {selectedItems.map((item, index) => (
                            <div key={index}>
                                <div className="d-flex justify-content-between">
                                    <p>{item.name}</p>
                                    <p>Price: &#8377;{item.price}</p>
                                    <p>Quantity: {item.quantity}</p>
                                </div>
                                <img src={item.imageUrl} alt={item.name} className="img-fluid" />
                            </div>
                        ))}

                        <div className="form-group">
                            <label htmlFor="cardNumber">Card Number</label>
                            <input
                                type="text"
                                className="form-control"
                                id="cardNumber"
                                name="cardNumber"
                                value={cardInfo.cardNumber}
                                onChange={handleInputChange}
                            />
                        </div>
                        <div className="form-group">
                            <label htmlFor="cardName">Name on Card</label>
                            <input
                                type="text"
                                className="form-control"
                                id="cardName"
                                name="cardName"
                                value={cardInfo.cardName}
                                onChange={handleInputChange}
                            />
                        </div>
                        <div className="form-group">
                            <label htmlFor="expires">Expires</label>
                            <input
                                type="text"
                                className="form-control"
                                id="expires"
                                name="expires"
                                value={cardInfo.expires}
                                onChange={handleInputChange}
                            />
                        </div>
                        <div className="form-group">
                            <label htmlFor="cvc">CVC</label>
                            <input
                                type="text"
                                className="form-control"
                                id="cvc"
                                name="cvc"
                                value={cardInfo.cvc}
                                onChange={handleInputChange}
                            />
                        </div>
                    </div>
                    <div className="modal-footer">
                        <p>Total: &#8377;
                            {selectedItems.reduce((total, item) => total + item.price * item.quantity, 0)}
                        </p>
                        <button type="button" className="btn btn-success" onClick={handleBuyNow}>
                            Buy Now
                        </button>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default BuyNow;
